import React, { useEffect } from "react";

const ShowTodoList = ({ todos }) => {
  useEffect(() => {
    console.log("Tareas en ShowTodoList:", todos); // Verificar datos
  }, [todos]);

  return (
    <div>
      <h2>Lista de Tareas</h2>
      {todos.length > 0 ? (
        <ul>
          {todos.map((todo) => (
            <li key={todo._id} style={{ border: "1px solid black", padding: "10px", margin: "5px" }}>
              <h3>{todo.title}</h3>
              <p>{todo.description}</p>
              <p>Fecha: {new Date(todo.date).toLocaleDateString()}</p>
              <p>Prioridad: {todo.priority}</p>
            </li>
          ))}
        </ul>
      ) : (
        <p>No hay tareas disponibles</p>
      )}
    </div>
  );
};

export default ShowTodoList;
